<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <link rel="stylesheet" href="globals.css" />
    <link rel="stylesheet" href="styleguide.css" />
    <link rel="stylesheet" href="style.css" />
  </head>
  <body>
    <div class="gallery">
      <div class="frame">
        <div class="div">
          <img class="logo" src="img/logo.svg" />
          <p class="checkt-ai-the-green">
            <span class="text-wrapper">Checkt.ai</span> <span class="span">The Green</span>
          </p>
        </div>
        <div class="frame-2"></div>
        <div class="frame-3">
          <div class="frame-4">
            <div class="frame-5"></div>
            <div class="text-wrapper-2">Filters</div>
            <div class="frame-6"></div>
            <div class="frame-7"></div>
          </div>
          <div class="frame-8">
            <div class="frame-9">
              <div class="text-wrapper-3">Resident Name</div>
              <div class="div-wrapper"><div class="text-wrapper-4">Jane Doe</div></div>
            </div>
            <div class="frame-9">
              <div class="text-wrapper-3">Unit Number</div>
              <div class="div-wrapper"><div class="text-wrapper-4">315</div></div>
            </div>
            <div class="frame-9">
              <div class="text-wrapper-3">Room</div>
              <div class="div-wrapper"><div class="text-wrapper-4">Kitchen</div></div>
            </div>
            <div class="frame-9">
              <div class="text-wrapper-3">Item</div>
              <div class="div-wrapper"><div class="text-wrapper-4">Microwave</div></div>
            </div>
            <div class="frame-9">
              <div class="text-wrapper-3">Date</div>
              <div class="div-wrapper"><div class="text-wrapper-4">MM/DD/YYYY</div></div>
            </div>
            <div class="frame-9">
              <div class="frame-9"><div class="text-wrapper-3">State</div></div>
              <div class="frame-10">
                <div class="frame-11">
                  <div class="frame-12">
                    <div class="text-wrapper-5">Passed</div>
                    <img class="group" src="img/image.svg" />
                  </div>
                  <div class="rectangle"></div>
                </div>
                <div class="frame-11">
                  <div class="frame-12">
                    <div class="text-wrapper-5">Failed</div>
                    <img class="group" src="img/group-22-5.svg" />
                  </div>
                  <div class="rectangle"></div>
                </div>
                <div class="frame-11">
                  <div class="frame-12">
                    <div class="text-wrapper-5">No Photo</div>
                    <div class="group-2"></div>
                  </div>
                  <div class="rectangle-wrapper"><div class="rectangle-2"></div></div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div class="frame-13">
        <div class="frame-14">
          <div class="frame-5"></div>
          <div class="text-wrapper-6">Gallery</div>
          <div class="frame-6"></div>
          <div class="group-3">
            <div class="group-4">
              <img class="line" src="img/line-3.svg" /> <img class="img" src="img/line-4-2.svg" />
            </div>
            <div class="group-5">
              <img class="line-2" src="img/line-3-2.svg" /> <img class="line-3" src="img/line-4.svg" />
            </div>
          </div>
          <div class="frame-7"></div>
        </div>
        <div class="frame-15">
          <div class="frame-16">
            <div class="photo"><img class="group-6" src="img/group-22-6.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-6.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-3.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-16.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-14.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-4.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-5.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-12.png" /></div>
          </div>
          <div class="frame-16">
            <div class="photo"><img class="group-6" src="img/group-22.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-2.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-18.png" /></div>
            <div class="photo"><img class="group-6" src="img/image.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-2.png" /></div>
            <div class="group-wrapper"><img class="group-6" src="img/group-22-10.png" /></div>
          </div>
          <div class="frame-16">
            <div class="photo"><img class="group-6" src="img/group-22-4.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-4.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-4.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-3.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-8.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-9.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-11.png" /></div>
            <div class="group-wrapper"><img class="group-6" src="img/group-22-15.png" /></div>
          </div>
          <div class="frame-16">
            <div class="photo"><img class="group-6" src="img/property-1-default.svg" /></div>
            <div class="photo"><img class="group-6" src="img/property-1-variant2.svg" /></div>
            <div class="photo"><img class="group-6" src="img/property-1-variant2.svg" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-6.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-17.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-19.png" /></div>
            <div class="photo"><img class="group-6" src="img/group-22-7.png" /></div>
            <div class="group-wrapper"><img class="group-6" src="img/group-22-13.png" /></div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
